def seperate_config(config_list):
	xdata, ydata, zdata = [], [], []
	for i in config_list:
		temp = i.split("_")
		if(len(temp)==5):
			xdata.append(reso_list.index(int(temp[1])))
			ydata.append(qp_list.index(int(temp[4])))
			zdata.append(1)
		elif(len(temp)==4):
			xdata.append(reso_list.index(int(temp[1])))
			ydata.append(qp_list.index(int(temp[3])))
			zdata.append(0)
		elif(len(temp)==3):
			if(temp[0]=='jpeg'):
				xdata.append(0)
				ydata.append(qp_list.index(int(temp[2])))
				zdata.append(1)
			else:
				xdata.append(reso_list.index(int(temp[1])))
				ydata.append(0)
				zdata.append(1)
		elif(len(temp)==2):
			if(temp[0]=='reso'):
				xdata.append(reso_list.index(int(temp[1])))
				ydata.append(0)
				zdata.append(0)
			else:
				xdata.append(0)
				ydata.append(qp_list.index(int(temp[1])))
				zdata.append(0)
		else:
			p = 1
	for i in range(len(xdata)):
		print(xdata[i],ydata[i],zdata[i])
	return xdata, ydata, zdata
			
			
